  \"Ecology of Nesting Bald Eagles on the Kenai National Wildlife Refuge, Alaska\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:47.436998\",\n\t\"name\": \"ecology-of-nesting-bald-eagles-on-the-kenai-national-wildlife-refuge-alaska\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Bald eagles (Haliaeetus leucocephalus)
  were censused in a boreal forest region on and near the 688,000 ha Kenai National
  Wildlife Refuge for the first time in 1979. Although only four active nests were
  observed in 10 randomly selected 10.4 square km quadrats, a total of 22 active nests
  were observed by checking locations where eagle nests were reported in the past.
  Twenty-three active nests were observed in 1980. An average of 1.0 and 1.4 eaglets
  per nesting pair were recorded in 1979 and 1980, respectively. The majority of bald
  eagle nests were in cottonwood (Populus trichocarpa) or aspen (Populus tremuloides)
  trees. Eagles preferred nest sites near clear streams where ice break-up occurred
  early in the spring and where spawning rainbow, trout (Salmo gairdneri) and longnose
  suckers (Catostomus catostomus) utilized streams or lakes. A high concentration
  of nests were located in the Moose River drainage, but few nests were located in
  the Swanson River and Chickaloon River drainages. Causes of nest loss, abandonment,
  and utilization are discussed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
